import React from 'react';
import { Form } from 'react-bootstrap';

import '../contact.css';


{/* Contact page */}

function Contact() {
    return (
       <div className="container">
           <form action="GET">
               <label>First Name</label>
               <input type="text" id="fname" name="firstname" placeholder="Your name.." />
           </form>
       </div>
    );
}

export default Contact;
